package shop.vo;

public class ChatBotVO {
	private String chatBotNo;
	private String custId;
	private String mngId;
	private String chatBotDate;
	private String chatBotContent;
	
	public ChatBotVO() {
		// TODO Auto-generated constructor stub
	}

	public String getChatBotNo() {
		return chatBotNo;
	}

	public void setChatBotNo(String chatBotNo) {
		this.chatBotNo = chatBotNo;
	}

	public String getCustId() {
		return custId;
	}

	public void setCustId(String custId) {
		this.custId = custId;
	}

	public String getMngId() {
		return mngId;
	}

	public void setMngId(String mngId) {
		this.mngId = mngId;
	}

	public String getChatBotDate() {
		return chatBotDate;
	}

	public void setChatBotDate(String chatBotDate) {
		this.chatBotDate = chatBotDate;
	}

	public String getChatBotContent() {
		return chatBotContent;
	}

	public void setChatBotContent(String chatBotContent) {
		this.chatBotContent = chatBotContent;
	}
	
	
	
}
